import Link from 'next/link';
import '../css/site.css'

const Header = () => (
  <div className="headerBar">
    <Link href="/">
      <span className="linkStyle">Home</span>
    </Link>
    <Link href="/about">
      <span className="linkStyle">About</span>
    </Link>
    <Link href="/blog">
      <span className="linkStyle">Blog</span>
    </Link>
  </div>
);

export default Header;
